import React, { Suspense } from 'react'
import PropTypes, { oneOfType } from 'prop-types'

const Loadable = ({ children }) => (
  <Suspense fallback={<div>Loading...</div>}>
    {children}
  </Suspense>
)

Loadable.propTypes = {
    children: oneOfType([
        PropTypes.element,
        PropTypes.array,
    ])
}

export default Loadable
